import React, { Component } from "react";
import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    var name = this.props.cards.map(title => <h1>{title}</h1>);
    return (
      <div className="main">
        {console.log(name)}
        <Cards />
        <Cards />
        <Cards />
      </div>
    );
  }
}

export default CardList;
